import { Fragment } from 'react';
import styles from './Header.module.css';
import mealsImage from '../../aseets/meals.jpg';

const Header = (porops) => {
    return (
        <Fragment>
            <header>
                <h1>ReactMeals</h1>
                <button>Cart</button>
            </header>
            <div>
                <img src={mealsImage} alt="A table full of delicious " />
            </div>
        </Fragment>
    );
};


export default Header;
